import styles from './'

function Input({text,type,name,placeholder,handleOnChange,value}){
    return(
        <div>
         <label htmlFor={name}>{text}</label>
         <input
         type={type}
         name={name}
         id={name}
         placeholder={placeholder}
         onChange={type}
         value={value}
         
         />
        </div>
    )
}

export default Input
